import { useState } from 'react';
import {
  Box,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Grid,
  TextField,
  Input
} from '@material-ui/core';

import axios from 'axios'
import { useSelector, useDispatch } from 'react-redux';

const AccountProfileDetails = (props) => {
  const loginstate = useSelector(state => state.loggin);

  return (
    <form
      autoComplete="off"
      noValidate
      {...props}
    >
      <Card>
        <CardHeader
          subheader="딥러닝 이미지 추가 / 제거"
          title="Profile"
        />
        <Divider />
        <CardContent>
          <Grid
            container
            spacing={3}
          >
            <Grid
              item
              md={6}
              xs={12}
            >
              이미지 추가          
            </Grid>
            <Grid
              item
              md={6}
              xs={12}
            >
  <Input accept="image/*" id="contained-button-file" multiple type="file" />
  {/* <Button variant="contained" component="span">
    Upload
  </Button> */}
                  <Button>
                Upload
                </Button>
            </Grid>

            <Grid
              item
              md={6}
              xs={12}
            >
              이미지 제거
            </Grid>
            <Grid
              item
              md={6}
              xs={12}
            >
              <Button>
                DELETE
                </Button>
            </Grid>

            <Grid
              item
              md={6}
              xs={12}
            >
              이미지 클라우드 용량
            </Grid>
            <Grid
              item
              md={6}
              xs={12}
            >
              5기가 중 4.12기가
            </Grid>
          </Grid>
        </CardContent>
        <Divider />
        <Box
          sx={{
            display: 'flex',
            justifyContent: 'flex-end',
            p: 2
          }}
        >
          이미지 업로드 시 업로딩 바 표기
        </Box>
      </Card>
    </form>
  );
};

export default AccountProfileDetails;
